const SocialButton = ({ children, label, href }) => {
  const buttonProps = {
    cursor: "pointer",
    display: "inline-flex",
    fontSize: "20px",
  }

  return (
    <chakra.button
      as={"a"}
      href={href}
      target={"_blank"}
      rel={"noopener noreferrer"}
      {...buttonProps}
    >
      <VisuallyHidden>{label}</VisuallyHidden>
      {children}
    </chakra.button>
  )
}

